{ This is not a complicated demo program, but sometimes it's
  useful to have a `Hello, world' program handy to test a compiler
  installation. It should compile with any TP compatible compiler. :-) }

program fp (Output);

uses sysutils;

var i : integer;

begin

  {$MACRO ON}
   WriteLn ('Hello, world. This is fp');
   WriteLn( 'built with fpc pascal ', 
           FPC_VERSION, '.', FPC_RELEASE, '.', FPC_PATCH );

   case ParamCount of
     0 : WriteLn ('You have invoked this program with no arguments.');

     1 : begin
            WriteLn ('You have invoked this program with one argument.');
            WriteLn ('It is: ', ParamStr (1) )
         end;
     otherwise
        WriteLn ('You have invoked this program with ',
                 ParamCount, ' arguments.');
        WriteLn ('These are:');
        for i := 1 to ParamCount do begin
           WriteLn (ParamStr (i))
        end { if }
   end { case }

end. { fp }

{
  adjust these as necessary.  Keep within first or last 10 lines of file
  kate: indent-width 4;
  kate: mode Pascal; syntax pascal;
}
